@PUBLIC_Lea @SaigyoujiVivi I have been diagnosed with depression my Dad has depression, several of my friends have depression and I have an uncle who was successful at his suicide attempt and left a daughter behind.

Do you think that demonizing all of us is ok? 

Joking about it got me and others through.

@QTarantino_ I've been there many times. I have been diagnosed with depression. Although, I'm in a good spot at the moment. 

I've had people ignore me, delete me, even had nasty comments. When I was just trying to ask for help.

It makes it worse. It made me feel a burden and unloved.

